import React from "react";
import { Link } from "react-router-dom";
import "../css/dashboard.css";

const Dashboard = () => {
  // Dummy data for demonstration purposes
  const userName = "Skateboarder123";
  const learningProgress = 75; // Percentage
  const savedItemsCount = 5;
  const forumPostsCount = 10;

  return (
    <div className="dashboard-container">
      <h2>Welcome back, {userName}!</h2>
      <div className="dashboard-summary">
        <div className="summary-item">
          <h3>Learning Progress</h3>
          <p>{learningProgress}% Complete</p>
          <progress value={learningProgress} max="100"></progress>
        </div>
        <div className="summary-item">
          <h3>Saved Items</h3>
          <p>{savedItemsCount} items saved</p>
          <Link to="/shopping">View Saved Items</Link>
        </div>
        <div className="summary-item">
          <h3>Forum Activity</h3>
          <p>{forumPostsCount} posts</p>
          <Link to="/forum">Go to Forum</Link>
        </div>
      </div>
      <div className="dashboard-actions">
        <Link to="/learn" className="action-button">
          Start Learning
        </Link>
        <Link to="/shopping" className="action-button">
          Go Shopping
        </Link>
      </div>
    </div>
  );
};

export default Dashboard;
